import React, { useState } from 'react'
import "../Style/Books.css"

const Books = () => {
 let[books,setBooks]= useState([])



  let fetchApi=async()=>{
    let apiData=await fetch('http://localhost:4000/books')
    .then(resp=>resp.json())
    setBooks(apiData)
  }
  fetchApi()
  // console.log(books)
  return (
   <>
   <div className="books">
    {
      books.map((elem)=>{
        let{title,}=elem
        
      })
    }

   </div>
   
   </>
  )
}

export default Books
